

<?php
//Radio Options
$radio_ip = 'sonica1.mooo.com';
$radio_port = '8050';
$show_song_title = 'on'; // show_song_title: on - off. When it is on, it will show the currently playing song name on the player.
$show_album_art= 'on'; // Options: on - off. If this is on, the script will search the itunes search API for the currently playing song image and will show it on the player. If it doesnt find the image on itunes, it will not show the image and div. The script inserts the image file into <img src="now-playing.png"> in the player.php file. You can change the location of this image on the page or on your website. If $show_song_title is set off, this option will be ignored and set off. This is only available when $show_song_title is on.

$song_title_update = '1'; // The song name update interval in MINUTE form. 2 means 2 minute. That means the script will update the song name and album art every 2 minutes.

// Color Options, if you need white or transparent background use preimg.light.png and other .png files in the img folder, set them in js/player.css.
$song_title_color = 'trasnparent';
$player_background_color = 'transparent';
$player_size_width = '0px'; // Minumum 150px is suggested, below 300 the song name will expand if it is long.
$player_album_art_width= '150px';
$song_title_width = '150px';



/*include "config.php";*/
if($show_song_title == 'on') {
	            $fp = @fsockopen($radio_ip, $radio_port, $errno, $errstr, 5);
                if($fp) {
                @fputs($fp,"GET /7.html HTTP/1.0\r\nUser-Agent: XML Reader(Mozilla Compatible)\r\n\r\n");
                while(!feof($fp)) {
                $dataset = @fgets($fp, 1000);
                }
                @fclose($fp);
                $entries = explode(",",$dataset);
                $status=$entries[1];
                $currentlisteners=$entries[0];
                $bitrate=$entries[5];
                $songtitle=$entries[6];
                $maxlist=$entries[3];
if($show_album_art == 'on' && $show_song_title == 'on') {
                // itunes song art this is for removing the (original mix) and some other parts from the track name, itunes doesnt like.
                $songtitle_exp = explode("-", $songtitle); // This is for itunes album search. Explodes the track name into two by using - to get the artist and track name.
                $artist = $songtitle_exp[0];
                $artist = explode(" ", $artist); // Clear feat and thirdnames that itunes search does not like
                $artist = "$artist[0]" . " $artist[1]"; // Use only two first words from the artist name, usually name and surname
                function delete_all_between($beginning, $end, $string) {
                  $beginningPos = strpos($string, $beginning);
                  $endPos = strpos($string, $end);
                  if ($beginningPos === false || $endPos === false) {
                    return $string;
                  }
                  $textToDelete = substr($string, $beginningPos, ($endPos + strlen($end)) - $beginningPos);
                  return str_replace($textToDelete, '', $string);
                  }

                 $trackname = delete_all_between('(', ')', $songtitle_exp[1]);
                 $trackname = strip_tags($trackname);
                 $trackname = trim($trackname);
                // itunes song art this is for removing the (original mix) and some other parts  from the track name, itunes doesnt like.
                echo "<input id=artist type=hidden value=\"$artist\">"; // Hidden div used to give artistname to javascript on the player.php
                echo "<input id=trackname type=hidden value=\"$trackname\">"; // Hidden div used to give trackname to javascript on the player.php
}

                /*echo $songtitle; */// This is the full songname without any filter on the player.



} // FP Ends

}
